import React from 'react';

function App() {
  return (
    <div>
      <h1>Hello</h1>
    </div>
  )
}

const foodILike = [
  {
    name : 'mandu',
    image : 'http://aeriskitchen.com/wp-content/uploads/2020/09/Rolling_Dumplings_01-.jpg'
  },
  {
    name : 'tteokbokki',
    image : 'http://aeriskitchen.com/wp-content/uploads/2020/06/Seafood_Tteokbokki_01-1-1.jpg'
  },
  {
    name : 'jjajangmyeon',
    image : 'http://aeriskitchen.com/wp-content/uploads/2008/09/black_bean_paste-_myeon_00-.jpg'
  }
]

foodILike.map(function(list) {
  return list.name, list.image;
  console.log(list)
})

function Food(props) {
  return <h1>I like {props.fav}</h1>
}

export default App;
